const RegionsPricing : React.FC<IRegionsPricingProps> = ({data, setData, currentRegion, onRegionChange, onDelete, onEdit}) => {
  
  const handleDelete = (regionName: string) => {
    const updatedData: IRegionPricing[] = data.filter(region => region.name !== regionName)
    setData(updatedData)
    onDelete && onDelete()
  }

  const handleEdit = (regionName: string) => {
    onRegionChange(regionName)
    onEdit && onEdit()
  }

  return (
    <>
      {data && data.length > 0 ? <div className="text-foboh-text text-xs mt-10 mb-5">Saved Regions</div> : ""}
      {
        data && data.length > 0 ? (
          data.map((region: IRegionPricing, i) => {
          return <div key={i} className="mb-3"><SavedRegionsItem
            {...region}
            image={getImageCode(region.name)}
            isEditDisabled={region.name === currentRegion}
            onDelete={handleDelete}
            onEdit={handleEdit} /></div>
        })) : (
          <p className="text-xs text-foboh-text mt-3">No Saved Regions Yet</p>
        )
      }
    </>
  )
}

export default RegionsPricing
